@Voltaic Cell I think there’s a difference between your freedom of speech being actively violated and just acting like a total prick.

If someone wishes to be addressed with different pronouns, just do it and move on with your life; It’s really not that hard.

Just treat others the way you’d want to be treated, even if it’s something as minor as addressing them the way they wish to be addressed.

@LeeHasLeeway I have seen what fitting in, and conformity in general does the people. 

Yes, they face less social scrutiny from their peers, but as a collective, they carry a heavy burden of being conformed into an inherently anti-natalist society.

I would rather keep my humanity than conform out of it because of social pressure dictating me to do so.

@Dakalo Maedza My advice would be to use other projects that you can understand as examples. We all have to start somewhere and learning from example is one of the best methods (for me) to study.

Once you know how something works already in a game, like a mod, you can then look at that mods inner workings to see how it operates and build your own skills off of that.

As long as you still write your own custom code and don't steal anything preexisting of course. Nothing wrong with studying off of preexisting works! I got mine to work through trial and error while studying code of other mods and writing my own, I may just be some rando on the internet but I got faith in you. Good luck in the future!
